<h1>Operationen klar</h1>

Extraheringen av <em>GeneWeb</em> källfilen är avslutad.

<p>

Den har skapat en fil benämnd "$o".

<p>

Filen finns i huvudkatalogen för din <em>GeneWeb</em> distribution
nära kommandot "gwsetup" och "gwd". Du kan flytta den var du vill.

<p>

Du kan återvända till <a href="gwsetup?lang=$l;v=main.htm">huvudmenyn</a>.
